      pragma pg
      SELECT col2 * + + col2 / + - AVG ( DISTINCT + ( + - col2 ) ) + col2 * - ( col2 ), + 58 AS col2 FROM tab0 GROUP BY col2 HAVING NOT NULL BETWEEN NULL AND NULL;
  - name: tab0

